import React from "react";

export default function Eventlist() {
  return (
    <div className="eventlist">
      <div className="container">
        <div className="row">
          <div className="col-12">
            <h1>Programs & Events</h1>
            <p>List of Upcoming Events and Programs</p>
          </div>
        </div>
      </div>
    </div>
  );
}
